class Solution {
    public ListNode reverseList(ListNode head, int left, int right){
        int count = right - left + 1;
        ListNode new_head = null, ptr = head;
        while(count > 0){
            ListNode next_node = ptr.next;
            ptr.next = new_head;
            new_head = ptr;
            ptr = next_node;
            count--;
